/**
 * Created by agros on 07.06.2019.
 */
import React, {useEffect} from 'react';
import PropTypes from 'prop-types';

const CallsList = () => {

    //Loading posts bi id
    useEffect(() => {
        getPost(match.params.id)
    }, [getPost]);

    return (
        <div>CallsList</div>
    );
};

export default CallsList;
